import Header from './components/header';
import Sidebar from './components/sidebar';
import TaskList from './components/taskList';
import './App.css';
import ImportantTasksPage from './components/ImportantTasks Page';

function App() {
  return (
    <div className="app">
      <Header />
      <div className="app-body">
        <Sidebar />
        <TaskList />
      </div>
      < ImportantTasksPage />
    </div>
  );
}

export default App;
